import './App.css';
import Navbar from './components/Navbar';
import {Nav, NavbarContainer} from './components/Navbar/navbarElements'

function App() {
  return (
    <>
      <Nav>
        <NavbarContainer>
          <MobileIcon>
            <FaBars />
          </MobileIcon>
          <Navmenu>
            <NavItem>
              <NavLinks to="about">

              </NavLinks>
            </NavItem>
          </Navmenu>
        </NavbarContainer>
      </Nav>
    </>
  );
}

export default App;
